import { Card, CardContent, Typography } from "@mui/material";

export default function(props){
    return (
            <CardContent>
                <Typography variant="body2">{props.quote.content}</Typography>
                <Typography color="text.secondary">{props.author.name}</Typography>
            </CardContent>
    )
}
